import { createAsyncThunk } from "@reduxjs/toolkit";
import { PersonBasics } from "./basic-info-slice";

export const fetchDataDemo = async () => {
  const response = await (
    await fetch(`http://localhost:3000/resume.json`)
  ).json();
  const data = await response.afk.basic_infos;
  console.log(data);
};

export const fetchPersonData = async () => {
  const response = await fetch(`http://localhost:3000/resume.json`);
};
